import React from 'react';
import {BrowserRouter as Switch, Route, Router, Redirect} from 'react-router-dom';
import Welcome from './Pages/Welcome';
import './App.css';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = '';
  }

  render() {
    return(
      <Router>
        <div>
          <Switch>
            <Route path="/" exact>
              <Redirect to="/welcome" />
            </Route>

            <Route path="/welcome" component={Welcome} />
          </Switch>
          </div>
      </Router>
    );
  }
}

export default App;
